import React from "react";

const Main = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-sm-6">
          <div className="shows">Shows</div>
        </div>
        <div className="col-sm-6">
          <div className="music">Music</div>
        </div>
      </div>
    </div>
  );
};

export default Main;
